"use strict";(self.webpackChunkwaste_of_space_wiki=self.webpackChunkwaste_of_space_wiki||[]).push([[2232],{46237:e=>{e.exports=JSON.parse('{"tag":{"label":"Starter","permalink":"/Pilot.lua-Luau-LSP/tags/starter","allTagsPath":"/Pilot.lua-Luau-LSP/tags","count":16,"items":[{"id":"objects/Antenna","title":"Antenna","description":"A wireless transmitter that can transmit electricity from wires and trigger signals from trigger wires and buttons.","permalink":"/Pilot.lua-Luau-LSP/objects/Antenna"},{"id":"objects/Assembler","title":"Assembler","description":"Assembles items as configured when the structure is supplied with the required power and resources.","permalink":"/Pilot.lua-Luau-LSP/objects/Assembler"},{"id":"objects/Bin","title":"Bin","description":"Stores solid items such as Aluminum, Iron, Faucets, etc.","permalink":"/Pilot.lua-Luau-LSP/objects/Bin"},{"id":"objects/BurnerGenerator","title":"BurnerGenerator","description":"Creates electricity when fueled with coal.","permalink":"/Pilot.lua-Luau-LSP/objects/BurnerGenerator"},{"id":"objects/Chute","title":"Chute","description":"Used to transfer solid resources between objects such as bins and extractors.","permalink":"/Pilot.lua-Luau-LSP/objects/Chute"},{"id":"objects/CloningBay","title":"CloningBay","description":"Allows you to respawn at it from a remote location.","permalink":"/Pilot.lua-Luau-LSP/objects/CloningBay"},{"id":"objects/Extractor","title":"Extractor","description":"Harvests or mines materials from the world. It can extract things like grass, snow, wood, ores, etc depending on what terrain it is attached to.","permalink":"/Pilot.lua-Luau-LSP/objects/Extractor"},{"id":"objects/HyperDrive","title":"HyperDrive","description":"A device used to travel at faster than light speeds to other regions of the universe.","permalink":"/Pilot.lua-Luau-LSP/objects/HyperDrive"},{"id":"objects/IonRocket","title":"IonRocket","description":"A simple, fast propulsion device which consumes power to produce thrust. Moves in the direction of the arrow.","permalink":"/Pilot.lua-Luau-LSP/objects/IonRocket"},{"id":"objects/Kiln","title":"Kiln","description":"Turns attached sand bins into glass.","permalink":"/Pilot.lua-Luau-LSP/objects/Kiln"},{"id":"objects/Polysilicon","title":"Polysilicon","description":"An electronic material which transforms a trigger signal into special on/off/toggle signals.","permalink":"/Pilot.lua-Luau-LSP/objects/Polysilicon"},{"id":"objects/SpawnPoint","title":"SpawnPoint","description":"Acts as a spawn location for the player who locked it.","permalink":"/Pilot.lua-Luau-LSP/objects/SpawnPoint"},{"id":"objects/Tank","title":"Tank","description":"Stores liquids and gases. When a liquid or gas touches the Tank, the Tank will automatically store it. Will not conduct heat when containing a fluid, making it a good heat storage part.","permalink":"/Pilot.lua-Luau-LSP/objects/Tank"},{"id":"objects/Thruster","title":"Thruster","description":"A high powered propulsion device. The larger the thruster, the faster it can go, up to 500s/s, but it will consume more power.","permalink":"/Pilot.lua-Luau-LSP/objects/Thruster"},{"id":"objects/Transporter","title":"Transporter","description":"Acts as an antenna but for bins and objects containing materials such as liquids and solids.","permalink":"/Pilot.lua-Luau-LSP/objects/Transporter"},{"id":"objects/Wire","title":"Wire","description":"Allows electrical objects to interact with each other when connected by wires. For example, attaching a wire between a powercell and a light will allow electricity to move through the wire, allowing the light to function causing a source of light to be created.","permalink":"/Pilot.lua-Luau-LSP/objects/Wire"}],"unlisted":false}}')}}]);